pragma solidity 0.6.12;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "@openzeppelin/contracts/utils/EnumerableSet.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "./AdcToken.sol";

contract AdvertiseNFT is ERC721("Advertise NFT","AdsNFT"),Ownable{

  using SafeMath for uint256;
  uint256 private sequence = 0; //token_id
  AdcToken private _adcToken; //AdcAdc
  uint256 private useOfAdc; //NFTAdc
  uint256 private nftFee;   //NFT
  uint256 private nftDefaultPrice = 100; //NFT100 Adc
  // Token name
  string private _name;
  // Token symbol
  string private _symbol;


  mapping(uint => string) linkURLInfo;
  mapping(uint => uint) nftPrice;

  event CreateAdvertiseNFT(string tokenURI,string linkURL);
  event Transfer(uint256 tokenId);

   constructor(
        AdcToken adcToken,
        uint _useOfAdc,
        uint _nftFee
    ) public {
        _adcToken = adcToken;
        useOfAdc = _useOfAdc;
        nftFee = _nftFee;
    }

  //NFT
  function _createAdvertiseNFT(string memory tokenURI,string memory linkURL) internal {
    sequence = sequence.add(1);      //token_id
    _safeMint(msg.sender,sequence);  //NFT
    _setTokenURI(sequence,tokenURI); //tokenURI
    linkURLInfo[sequence] = linkURL; //URL
    nftPrice[sequence] = nftDefaultPrice;
    emit CreateAdvertiseNFT(tokenURI,linkURL);  
  }

  //NFTAdc
  function crateAdvertiseNFT(string memory tokenURI,string memory linkURL) public {
    require(_adcToken.balanceOf(msg.sender)>=(useOfAdc+nftFee),"ADC");
    _adcToken.transfer(owner(),useOfAdc+nftFee); //ADC
    _createAdvertiseNFT(tokenURI,linkURL);
  }
  
  //adcowner
  function setAdcFee(uint256 _useOfAdc,uint256 _nftFee) public onlyOwner {
    useOfAdc = _useOfAdc;
    nftFee = _nftFee;
  }

  //baseURI,owner
  function setBaseURI(string memory baseURI) public onlyOwner {
    _setBaseURI(baseURI);
  }
  
  //
  function transfer(uint256 tokenId) public{
    require(_adcToken.balanceOf(msg.sender)>=nftPrice[tokenId],"ADC");
    _adcToken.transfer(ownerOf(tokenId),nftPrice[tokenId]); //ADC
    approve(msg.sender,tokenId);
    safeTransferFrom(ownerOf(tokenId),msg.sender,tokenId);
    emit Transfer(tokenId);
  }
  
  //linkURL
  function getLinkURL(uint256 tokenId) public returns (string memory){
     return linkURLInfo[tokenId];
  }

  //NFTlinkURL
  function setLinkURL(uint256 tokenId,string memory linkUrl) public{
    require(ownerOf(tokenId) == msg.sender,"NFT");
    linkURLInfo[tokenId] = linkUrl;
  }

  //NFT
  function setNftPrice(uint256 tokenId,uint256 price) public{
    require(ownerOf(tokenId) == msg.sender,"NFT");
    nftPrice[tokenId] = price;
  }

  //tokenId
  function getTokensByOwner() public returns (uint[] memory){
     uint256 len = balanceOf(msg.sender);
     uint[] memory result = new uint[](len);
        for (uint i = 0; i < len; i++) {
            result[i] = tokenOfOwnerByIndex(msg.sender,i);
        }
        return result;    
  }
   
}
